import React from "react";

export default function Home() {
  let timer = 360;
  const style = {
    transform: `rotate(${timer}deg)`,
  };

  setInterval(() => {
    console.log(style.transform);
    timer -= 10;
  }, 1000);
  return (
    <div>
      <div className="timer">
        <div className="circle"></div>
        <div className="circle-inside" style={style}>
          <div className="dot"></div>
        </div>
      </div>
    </div>
  );
}
